css:
@-moz-document url-prefix("http://www.titulky.com/") {
#pagewrap {
    width: 100%
}
div#head {
    background: none;
    height: 45px
}
.iboxcover,
div#stat_bok_v,
div#stat_bok_h,
div#martevax-main,
a.tlacitko.titulkydownloadajax.cboxElement,
div#head_b,
td.detailh,
div#zavstat {
    display: none
}
#side2wrap {
    width: 100%;
    margin: 0 auto
}
div#side1wrap {
    width: 100%
}
#bannery300x300 {
    display: none
}
div#side1cont {
    margin: 0 auto;
    float: none
}
tr[valign="middle"],
div#head_a2 {
    display: none
}
img#headlogotitulky {
    content: url(data:image/png;base64,);
}
div#head_a1 {
    width: 100%;
    height: 40px;
    padding-top: 0
}
div#head_a,
div#pagecont {
    width: 100%
}
div#pagecont2 {
    float: left;
    width: 100%
}
.scopedetail {
    margin: 0 auto;
    width: 680px
}
div#contcont {
    width: 100%
}
table.soupis {
    margin: 0 auto
}
input#search_submit {
    display: none
}
table.detail tr th {
    background-color: grey
}
table.detail tr.detailv td,
table.detail tr td.detailv {
    background: #fff;
    border: 1px solid #e2e2e2
}
table.detail tr th {
    background-color: grey
}
table.detail tr.detailv td,
table.detail tr td.detailv {
    background: #fff;
    border: 1px solid #e2e2e2
}
body,
html,
div#bodywrap,
div#pagewrap1,
div#pagewrap2,
div#pagecont,
div#side1wrap,
div#contcont,
div#side2wrap {
    background-color: #333439
}
tr.detailv {
    display: none
}
table.soupis tr.r1 td,
table.soupis tr.r0 td,
table.soupis tr.r td {
    background: #242428;
    color: #fff
}
a {
    color: #fff!important
}
table.detail tr.detailv td,
table.detail tr td.detailv {
    background: #333439;
    border: 1px solid #e2e2e2;
    color: #fff;
    border-radius: 0
}
table.detail tr th {
    background-color: #1b1b1e;
    text-align: center
}
div#bodywrap,
div#pagewrap1,
div#pagewrap2,
div#pagecont,
div#side1wrap,
div#contcont,
div#side2wrap {
    background-color: #333439;
    color: #fff
}
table#tablelogon,
table#tablesearch {
    -webkit-filter: grayscale()
}
table.detail h2 {
    display: none
}
table.soupis tr td {
    font-size: 13px;
    height: 25px;
    padding-left: 10px;
    border-radius: 0;
    -moz-border-radius: 0;
    -webkit-border-radius: 0
}
.detailh2 {
    color: #fff
}
img[alt="Hodnocení"],
img[alt="bez fotografie"] {
    display: none
}
a.titulkydownloadajax.cboxElement {
    display: block;
    background: #AC8E74;
    margin: 0 75px;
    padding: 15px;
    text-align: center;
    color: #fff;
    border-bottom: 2px solid #E4B790;
    border-top: 2px solid #E4B790;
}
div#cboxLoadedContent {
    width: 240px!important;
    height: 240px!important
}
div#cboxContent {
    height: 240px!important;
    width: 240px!important
}
div#cboxMiddleLeft {
    width: 240px!important;
    height: 240px!important
}
div#cboxClose {
    display: none
}
table.detail {
    width: 100%;
    max-width: 664px;
    margin: 0 auto
}
table#tablelogon,
table#tablesearch {
    -webkit-filter: invert(.8)
}
div#side1cont {
    background: none
}
#pagefoot {
    display: none
}
#side1cont {
    display: flex;
    width: 300px;
    flex-wrap: wrap;
}
table#tablesearch {
    order: 1;
}
form[name="searchformsub"] {
    order: 1;
    display: flex;
}
div#side1cont {
    display: flex;
    flex-wrap: wrap;
}
table#tablelogon {
    order: 10;
}
div#pagecont2 {
    display: flex;
    flex-wrap: wrap;
}
table#tablelogin {
    -webkit-filter: invert(.8);
}
iframe {
    display: none;
}
img[alt="CZ"],img[alt="SK"] {
    -webkit-filter: grayscale(0.7);
}
table.detail tr th {
    -webkit-filter: grayscale(.7);
}
.ac_results {
    width: 260px !important;
    border: 1px solid #585858;
    border-radius: 5px;
}
.ac_over {
    background: #AC8E74;
    padding: 5px 5px;
}
}
